import React from 'react';
import { StyleSheet, View, Text } from 'react-native';
import IconFA from 'react-native-vector-icons/FontAwesome';

const IconInCircle = (
    { circleSize, borderWidth = 2,
      borderColor = "black", ...props }) => (
    <View
        style={{
            width: circleSize,
            height: circleSize,
            borderRadius: .5 * circleSize,
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            backgroundColor: '#c3cede'
        }}
    >
        <IconFA
            {...props}
        />
    </View>
)


export default function NotificationsTab() {
    return (
        <View style={styles.container}>
            <View style={styles.title}>
                <Text style={{
                    fontSize: 16,
                    color: 'black',
                }}>Latest Notifications</Text>
            </View>
            <View style={styles.notify}>
                <View style={styles.notification}>
                    <IconInCircle
                        name="bell-o"
                        size={25}
                        color="#3367e8"
                        style={styles.thumbnail}
                        borderWidth={1}
                        circleSize={50}
                    />
                </View>
                <View style={styles.notificationLine}>
                    <Text style={styles.note}>
                        Your appoinment has been booked successfully.
                    </Text>
                </View>

            </View>
            <View style={styles.notify}>
                <View style={styles.notification}>
                    <IconInCircle
                        name="bell-o"
                        size={25}
                        color="#3367e8"
                        style={styles.thumbnail}
                        borderWidth={1}
                        circleSize={50}
                    />
                </View>
                <View style={styles.notificationLine}>
                    <Text style={styles.note}>
                        Your appoinment has been reschedule.
                    </Text>
                </View>

            </View>
            <View style={styles.notify}>
                <View style={styles.notification}>
                    <IconInCircle
                        name="bell-o"
                        size={25}
                        color="#3367e8"
                        style={styles.thumbnail}
                        borderWidth={1}
                        circleSize={50}
                    />
                </View>
                <View style={styles.notificationLine}>
                    <Text style={styles.note}>
                        Your appoinment has been canceled.
                    </Text>
                </View>

            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#e9ebf0',
        height: '100%',
        width: 'auto'
    },
    note: {
        fontSize: 16,
        backgroundColor: '#e9ebf0',
        color: 'black',
        padding: 15,
    },
    notify: {
        flexDirection: 'row',
        backgroundColor: '#e9ebf0',
        marginTop: 5,
        paddingHorizontal: 10,
        justifyContent: 'flex-start',
    },
    title: {
        backgroundColor: "#e9ebf0",
        height: 30,
        paddingLeft: 20,
        justifyContent: 'center',
        borderBottomColor: '#191a1c',
        borderBottomWidth: 1.3
    },
    thumbnail: {
        height: 68,
        width: 68,
        justifyContent: 'center',
        alignItems: 'center',
        alignSelf: 'center',
        marginLeft: 43,
        marginTop: 40,
    },
    notification: {
        paddingLeft: 10,
        height: 'auto',
        backgroundColor: '#e9ebf0',
        alignContent: 'center',
        alignSelf: 'center',
        justifyContent: 'center'
    },
    notificationLine: {
        flex: 1
    }
});
